import Form from "./Form";
import Tasks from "./Tasks";

const task = [
  { id: 1, content: "przejsc na Reacta", done: false },
  { id: 2, content: "zjesc obiad", done: true },
];
const hideDoneTasks = [];
function App() {
  return (
    <main className="main">
      <header>
        <h1>
          Lista zadań
        </h1>
      </header>
      <section className="section">
        <h2 className="section__headline">
          Dodaj nowe zdanie
        </h2>-
        <div className="section__body">
          <Form />
        </div>
      </section>

      <section className="section">
        <h2 className="section__headline">
          Lista zadań
          <div className="main__headlineButtons main__headlineButtons"></div>
        </h2>
        <div>
          <Tasks key={task.id} tasks={task} hideDoneTasks={hideDoneTasks} />
        </div>

      </section>
    </main>
  );
}

export default App;
